import React from "react";
import './style.css';

export default function Content(props){
    if (props.name == "home") {
        return (
            <>
                <h1 id="title">Welcome to the future</h1>
                <h1 id="subtitle">The Macroeconomic DAO</h1>
            </>
        );
    }
}
